import React, { useState, useEffect } from 'react';
import './SimulationPage.css';
import bowlingImage from '../images/bowling.jpg';

function SimulationPage() {

    const [gameState, setGameState] = useState({ rolls: [], totalScore: 0 });

    useEffect(() => {
        fetchGameState();
      }, []);

    const fetchGameState = async () => {
        const res = await fetch('http://localhost:3001/api/gameState');
        const data = await res.json();
        setGameState(data);
    };

    const handleSimulate = async () => {
        const res = await fetch('http://localhost:3001/api/simulateRoll', {
          method: 'POST',
        });
        const data = await res.json();
        setGameState(data); 
      };
    
      const handleReset = async () => {
        const res = await fetch('http://localhost:3001/api/resetGame', {
          method: 'POST',
        });
        const data = await res.json();
        setGameState(data);
      };
    
      console.log('Game State:', gameState);

  return (
    <div className="simulation-page">

      <div className="simulation-container">
        <table className="bowling-score-table">
          <thead>
            <tr>
              {[...Array(9)].map((_, i) => (
                <th key={i} colSpan="2">{i + 1}</th>
              ))}
              <th colSpan="3">10</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              {[...Array(9)].map((_, i) => (
                <React.Fragment key={i}>
                  <td className="frame-shot" id="b"></td>
                  <td className="frame-shot"></td>
                </React.Fragment>
              ))}
              <td className="frame-shot"></td>
              <td className="frame-shot"></td>
              <td className="frame-shot"></td>
            </tr>

            <tr>
              <td colSpan="2" className="score-total"></td>
              <td colSpan="2" className="fram-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="2" className="frame-total"></td>
              <td colSpan="3" className="frame-total"></td>
            </tr>
          </tbody>
        </table>
      </div>

        <img src={bowlingImage} alt="Bowling" className="bowling-image" />

        <div className="simulation-controls">
            <div className="button-row">
                <button type="button" className="play-button">Play</button>
                <button type="button" className="play-button" onClick={handleSimulate}>Simulate</button>
                <button type="button" className="play-button">Simulate&nbsp;Game</button>
            </div>

            <div className="button-row">
                <button type="button" className="undo-button">Undo</button>
                <button type="button" className="reset-button" onClick={handleReset}>Reset</button>
            </div>
        </div>
    </div>
  );
}

export default SimulationPage;
